import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import BuyerOrder from "../screens/BuyerOrder";
import AdminDashBoard from "../screens/AdminDashBoard";
import AddCategories from "../screens/AddCategories";
import BuyerAccount from "../screens/BuyerAccount";
import AdminRequest from "../screens/AdminRequest";
import {
  Entypo,
  MaterialIcons,
  FontAwesome,
  MaterialCommunityIcons,
} from "@expo/vector-icons";
import ComplaintScreen from "../screens/ComplaintScreen";

const Tab = createBottomTabNavigator();

export default function SellerTabs() {
  return (
    <Tab.Navigator
      initialRouteName="AdminDashBoard"
      screenOptions={{
        headerShown: false,
        tabBarStyle: {
          backgroundColor: "white",
        },
        tabBarShowLabel: false,
      }}
    >
      <Tab.Screen
        name="AdminDashBoard"
        component={AdminDashBoard}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <Entypo name="home" size={24} color="#003580" />
            ) : (
              <Entypo name="home" size={24} color="black" />
            ),
        }}
      />

      <Tab.Screen
        name="AddCategories"
        component={AddCategories}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <MaterialIcons name="assignment" size={24} color="#003580" />
            ) : (
              <MaterialIcons name="assignment" size={24} color="black" />
            ),
        }}
      />
      <Tab.Screen
        name="AdminRequest"
        component={AdminRequest}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <MaterialCommunityIcons name="post" size={24} color="#003580" />
            ) : (
              <MaterialCommunityIcons name="post" size={24} color="black" />
            ),
        }}
      />
      <Tab.Screen
        name="ComplaintScreen"
        component={ComplaintScreen}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <MaterialCommunityIcons
                name="account-question"
                size={24}
                color="#003580"
              />
            ) : (
              <MaterialCommunityIcons
                name="account-question"
                size={24}
                color="black"
              />
            ),
        }}
      />
      <Tab.Screen
        name="BuyerAccount"
        component={BuyerAccount}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <FontAwesome name="user" size={24} color="#003580" />
            ) : (
              <FontAwesome name="user" size={24} color="black" />
            ),
        }}
      />
    </Tab.Navigator>
  );
}
